function href($url)
{
	$ch = curl_init();
	curl_setopt($ch, CURLOPT_URL, $url);
	curl_setopt($ch, CURLOPT_RETURNTRANSFER,1);
	curl_setopt($ch, CURLOPT_CONNECTTIMEOUT,5);
	$res = curl_exec($ch);
	curl_close($ch);
	preg_match_all("(href=\"(.*)\")siU",$res,$r1);
	$q=count($r1[1]);
	$res = [];
	for($i = 0;$i <$q ; $i++){
	    $res[] = $r1[1][$i];
	}
	
	return $res;
} 
function slash($e)
{
	global $path;
	$pathslash = $path.'/';
	$w = 'www'; 
	$com = '.com';
	$js = '.js';
	$css = '.css';
	$ico = '.ico';
	$png = '.png';
	$jpg = '.jpg';
